import Styling from "./App.module.css";
import LeftSidebar from "./components/LeftSidebar";

function App() {
  return (
    <div className={Styling.App}>
      <LeftSidebar className={Styling.leftNavbar} />
      <div className={Styling.topNavbar}>top navbar</div>
      <div className={Styling.projectsContainer}>projects</div>
    </div>
  );
}

export default App;
